public class InnerResourceDefinitionResourceDataContainerFactory(Action<Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer> factoryAction = null) : SubResourceFactory<Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer>
{

    internal InnerResourceDefinitionSecretsManagerSecretResourceDataFactory SecretsManagerSecretResourceDataFactory { get; set; }

    internal InnerResourceDefinitionSageMakerMachineLearningModelResourceDataFactory SageMakerMachineLearningModelResourceDataFactory { get; set; }

    internal InnerResourceDefinitionLocalVolumeResourceDataFactory LocalVolumeResourceDataFactory { get; set; }

    internal InnerResourceDefinitionLocalDeviceResourceDataFactory LocalDeviceResourceDataFactory { get; set; }

    internal InnerResourceDefinitionS3MachineLearningModelResourceDataFactory S3MachineLearningModelResourceDataFactory { get; set; }

    protected override Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer Create()
    {
        var resourceDataContainerResult = CreateResourceDataContainer();
        factoryAction?.Invoke(resourceDataContainerResult);

        return resourceDataContainerResult;
    }

    private Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer CreateResourceDataContainer()
    {
        var resourceDataContainerResult = new Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer();

        return resourceDataContainerResult;
    }
    public override void CreateChildren(Humidifier.Greengrass.ResourceDefinitionTypes.ResourceDataContainer result)
    {
        base.CreateChildren(result);

        result.SecretsManagerSecretResourceData ??= SecretsManagerSecretResourceDataFactory?.Build();
        result.SageMakerMachineLearningModelResourceData ??= SageMakerMachineLearningModelResourceDataFactory?.Build();
        result.LocalVolumeResourceData ??= LocalVolumeResourceDataFactory?.Build();
        result.LocalDeviceResourceData ??= LocalDeviceResourceDataFactory?.Build();
        result.S3MachineLearningModelResourceData ??= S3MachineLearningModelResourceDataFactory?.Build();
    }

} // End Of Class

